import React from "react";
import { BsBookmarkCheck } from "react-icons/bs";
import Check from "./Check";

const TodoItem = ({ todo }) => {
  return (
    <div>
      {todo.title},
      <Check />
    </div>
  );
};

export default TodoItem;
